import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import LinesRenderer from './components/renderers/LinesRenderer';
import TrianglesRenderer from './components/renderers/TrianglesRenderer';
import ShadedTrianglesRenderer from './components/renderers/ShadedTrianglesRenderer';

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/lines">Lines Renderer</Link>
            </li>
            <li>
              <Link to="/triangles">Triangles Renderer</Link>
            </li>
            <li>
              <Link to="/shaded-triangles">Shaded Triangles Renderer</Link>
            </li>
            {/* Add more links for additional renderers */}
          </ul>
        </nav>

        <Switch>
          <Route path="/lines">
            <LinesRenderer />
          </Route>
          <Route path="/triangles">
            <TrianglesRenderer />
          </Route>
          <Route path="/shaded-triangles">
            <ShadedTrianglesRenderer />
          </Route>
          {/* Add more routes for additional renderers */}
          <Route path="/">
            <HomePage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
